import logo from './logo.svg';
import './App.css';
import Post from './Post.js';
import React from 'react';

class App extends React.Component {
  constructor(){
    super();
    this.state = {
      posts: Array()
    };
  }

  render() {
    return (
      <div className="body">
      <h1>Posts' list</h1>
      <Post result={this.state.posts[0]}/>
      </div>
    );
  }

}

export default App;
